app.controller('QuestionCtrl', function($scope) {
	
});
angular.module('workover-webservice')
.directive("wysiwyg", function () {
	var linkFn = function (scope, el, attr, ngModel) {
		// TODO: Add user preferences and save this in Authuser and database
		scope.redactor = el.redactor({
			'focus': false,
			'shortcuts': false,
			'execCommandCallback': function() { // When things like style changed or font updated
				scope.$apply(ngModel.$setViewValue(scope.redactor.getCode()));
			},
			'keyupCallback': function() { // When user types stuff
				scope.$apply(ngModel.$setViewValue(scope.redactor.getCode()));
			},
			'keydownCallback': function(obj, event) {
				if(event.keyCode == 9) {
					console.log('asd');
					el.blur();
				}
			},
			'callback': function (o) {
				ngModel.$render = function() {
					if(!!ngModel.$viewValue) {
						o.setCode(ngModel.$viewValue);
					}
				};
			}
		});
	}
	return {
		require: '?ngModel',
		link: linkFn,
		restrict: 'A'
	};
});
